(window.webpackJsonp=window.webpackJsonp||[]).push([[56],{642:function(e,a,o){"use strict";o.r(a);var s=o(15),n=Object(s.a)({},(function(){var e=this,a=e.$createElement,o=e._self._c||a;return o("ContentSlotsDistributor",{attrs:{"slot-key":e.$parent.slotKey}},[o("p",[e._v("Esta primera parte del curso 2023/2024, no solo ha traído los cambios de turno de mañana  tarde en el centro, si no diversas consecuencias por ello que ha hecho que ajustemos los biorrítmos siguiendo una de de las bromas que he tenido por ello. Te comento estos cambios.")]),e._v(" "),o("p",[e._v("Cambiar de turno a veces no es tan fácil como uno imagina. En mi caso ha venido unido a multitud de cambios y ajustes que han hecho el proceso un poco más complicado de lo habitual.")]),e._v(" "),o("p",[e._v("Se dice que es bueno cambiar de costumbres en el entorno laboral cada dos años. En el fondo, ir al turno de tarde ha tenido ese efecto. Aunque sea el mismo centro, implica conocer nuevas personas, adaptarse a nuevos horarios y cambiar determinados hábitos docentes. Por supuesto, ha implicado prepararse un nuevo módulo: "),o("a",{attrs:{href:"https://github.com/joseluisgs/DesarrolloWebEntornosServidor-00-2023-2024",target:"_blank",rel:"noopener noreferrer"}},[e._v("Desarrollo Web en Entornos Servidor"),o("OutboundLink")],1),e._v(". En este aspecto, he querido centrarme en varias tecnologías revisitando los contenidos del currículo con ellas y agrupándolas en varios grupos: JVM (y Srpingboot), Node.js (y Nest.js) y finalmente PHP (y Laravel). Esperemos que el experimento salga bien. En el fondo, es un buen aliciente y una buena responsabilidad que me ha gustado.")]),e._v(" "),o("p",[e._v("El turno de tarde, es más tranquilo y agradable. A veces es como si no estuvieses en el mismo centro. Agradezco a todos mis compañeros/as que me hayan ayudado al cambio.")]),e._v(" "),o("p",[e._v('Pero este cambio ha supuesto cambiar muchas cosas en mi día a día. Y aunque no lo parezca una de las cosas que más me han costado es el cambio de los entrenamientos del tenis. Esto hace que ahora tenga que ir por las mañana y me ha costado ajustar todo. Quizás, porque me gustaba ir por la tarde cuando ya "todas las obligaciones docentes estaban hechas". Ahora vas con la cabeza pensando en lo que debes hacer esa tarde. Esto para mi es duro y a veces no lo disfruto, porque entre "bola y bola" tengo una petición REST en la cabeza por resolver o explicar para que entiendan el poder de los JWT. De hecho, la broma de los "cambios de biorritmos" salió de mi entrenados del CT Alborada, Miguel Ángel, y le doy las gracias por ello. Primero por su ayuda en todo el proceso, y luego por darme la excusa perfecta de mi lamentable estado algunos días.')]),e._v(" "),o("p",[e._v("Además, se ha juntado el tema de la guitarra. Ha habido muchos cambios, debido a mi nuevo luthier, el genial y fantástico "),o("a",{attrs:{href:"https://www.youtube.com/@juanbrievaluthier6637",target:"_blank",rel:"noopener noreferrer"}},[e._v("Juan Brieva"),o("OutboundLink")],1),e._v(". Él ha puesto al día y me ha ayudado a mejorar mis guitarras. Esto ha llevado un tiempo, y luego hay que volver a educar mi oído a tantos cambios. No siempre ha salido todo a la primera, y seguimos luchando con ello. Además, estos cambios implican mover algunos componentes, vender pedales, ajustar set-up. Seguimos en ello. Creo que eso es algo que no acaba nunca.")]),e._v(" "),o("p",[e._v("Si seguimos con la guitarra, he iniciado el proceso de buscar otra persona que me ayude a avanzar un poco. Mi profesor desaparece má que el guadiana con sus nuevas obligaciones en Shanghai. Yo pensaba que el nuevo horario nos daría la libertad de avanzar más (diferencias horarias) pero no ha sido así. Así que en eso andamos. Otra cosa que está minando un poco de energía diaria.")]),e._v(" "),o("p",[e._v('El cambio horario ha implicado que ya determinadas personas no cuenten conmigo a nivel formativo. Pero esto es algo normal y aunque como bien se dicen "los negocios son negocios" aprendes de ello para futuras ocasiones. en este tiempo sé que se siguen usando mis material y para eso están.')]),e._v(" "),o("p",[e._v("Estos meses también me han hecho lo desengañado con determinados aspectos de la comunidad de internet del desarrollo. Quizás a veces es bueno desconectar y alejarse de todo un poco para comprender mejor las cosas. Podría decir que hay tantos refritos y saturación que cansa tener que explicar determinados puntos de vista y que algunos sectores están cada vez más radicalizados.")]),e._v(" "),o("p",[e._v("Finalmente, si no fuera tantos cambios suficientes, he tenido que comprar un nuevo portátil. Lo siento mucho, pero para mi es imposible dar clase en los ordenadores congelados, donde día sí, día también me tengo que traer el código, probar librerías, ajustar los dockers, etc. Somos el único gremio que debe poner su propio material para dar clase. Espero que esto cambie. El año pasado, al menos tenía un portátil del departamento, este año no. Quizás porque este año ni lo he pedido. En cualquier caso tenía uno, pero no daba la talla con el IntellIj y otro software corriendo a la vez.")]),e._v(" "),o("p",[e._v('No quiero olvidarme de mi "gran vecino o empresa de limpieza" que me ha rallado el coche, otro cambio más.')]),e._v(" "),o("p",[e._v("En fin, muchos cambios y ajustes que espero que merezcan la pena.")])])}),[],!1,null,null,null);a.default=n.exports}}]);